import React from 'react';


const UsersList = ({users, base_url, onClick, onRemoveClick, editDelete}) => (

    <div className="table_container">
        <div className="Header row header_users">
            <div className="col-4">Nombre de usuario</div>
            <div className="col-4">Email</div>
            <div className="col-4">Acciones</div>
        </div>
        {
            users.length>0 ?
            (
                users.map(user =>
                    <UserDetail editDelete={editDelete} 
                                key={user.id} 
                                user={user} 
                                base_url={base_url} 
                                onClick={onClick} 
                                onRemoveClick={onRemoveClick}/>
                )
            ) : (
                <div key="no_results" className="no_results"> No se han encontrado resultados </div>
            )
        }
    </div>
);

const UserDetail = ({user, base_url, onClick, onRemoveClick}) => (
    <div className="entryDetail" key={user.id} data-id={user.id} onClick={onClick}>
        <div className="row">
            <div className="col-4 user_username">{user.username}</div>
            <div className="col-4">{user.email}</div>
            <div className="col-4">
                <i className="fas fa-edit user_actions_edit">Editar </i>
                <i className="fas fa-trash-alt" 
                    onClick={() => onRemoveClick(user.id)}>Borrar </i>
            </div>
        </div>
    </div>
)

export default UsersList;
